" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pigmented Spitz nevus (Reed nevus)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Pigmented spindle melanocytic tumor (Reed nevus) in an 11-year-old boy. A skin biopsy showed the typical changes of a pigmented spindle cell tumor, also known as a Reed nevus. It presents as a well-circumscribed, deeply pigmented nodule on the extremities of young adults. Histologically it is composed of spindled melanocytes with heavy melanin pigmentation. As in a Spitz tumor, this tumor is symmetrical with maturation and lack of deep dermal mitotic figures.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; David Elpern, MD, Dermatlas; file://www.dermatlas.org.",
"    </div>",
"   </div>",
