"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?33/55/34681/abstract/1\">",
"      Selo-Ojeme DO, Omosaiye M, Battacharjee P, Kadir RA. Risk factors for obstetric admissions to the intensive care unit in a tertiary hospital: a case-control study. Arch Gynecol Obstet 2005; 272:207.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?33/55/34681/abstract/2\">",
"      Mirghani HM, Hamed M, Ezimokhai M, Weerasinghe DS. Pregnancy-related admissions to the intensive care unit. Int J Obstet Anesth 2004; 13:82.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?33/55/34681/abstract/3\">",
"      Demirkiran O, Dikmen Y, Utku T, Urkmez S. Critically ill obstetric patients in the intensive care unit. Int J Obstet Anesth 2003; 12:266.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?33/55/34681/abstract/4\">",
"      Loverro G, Pansini V, Greco P, et al. Indications and outcome for intensive care unit admission during puerperium. Arch Gynecol Obstet 2001; 265:195.",
"     </a>",
"    </li>",
